import React from 'react';
import {formatPrice} from "../helpers"

class EditFishForm extends React.Component {
	handleOnChange(event) {

	};

	render() {
		return <div className="fish-edit">
			<input type="text" name="name" value={this.props.fish.name} placeholder="Name"/>
			<input type="text" name="price" value={formatPrice(this.props.fish.price)} placeholder="Price"/>

			<select type="text" value={this.props.fish.status} name="status">
				<option value="available">Fresh</option>
				<option value="unavailable">Sold Out!</option>
			</select>

			<textarea name="desc" value={this.props.fish.desc} placeholder="Description"/>
			<input type="text" name="image" value={this.props.fish.image} placeholder="Image"/>
		</div>	
	}
}

export default EditFishForm;
